import React, { Component } from "react";
import Aside from "../components/Aside";
import ListHead from "../components/ListHead";

class List extends Component {
    render () {
        return (
            <div className="page-display">
                <ListHead />
                <Aside />
            </div>
        );
    }
}

export default List;
